import React, {Component} from 'react';
import Task from "../task/task";
import TaskToggle from "../task-toogle/task-toggle";

export default class TaskListItem extends Component {




    render() {

        const  {className, id, mainFunction, other} = this.props;
        if(className === 'editing'){
            return (
                <li className={className}>
                    <Task other={other} className='view' mainFunction={mainFunction} mainClass={className} id={id}/>
                    <TaskToggle id={id}   mainFunction={mainFunction}  type="text" className="edit" value={other}/>
                </li>
            )
        }
        else {
            return (
                <li className={className}>
                    <Task   other={other} className='view' mainFunction={mainFunction} mainClass={className} id={id}/>
                    
                </li>
            )


        }



}
}

